import { UseLogout } from '../hooks/UseLogout'

const Logout = () => {

    const { logout } = UseLogout()
    
    const logoutHandler = () => {
        logout()
    }

    return ( 
        <div className="container border">
             <h5 className="text-end pt-3 pe-3">لیست های من </h5>
        </div>
     );
}
 
export default Logout;
